function createTSVFile(a){createFileDownloadLink(getFileDownloadName(".tsv"),"data:text/tsv;charset=utf-8,"+encodeURI(a.join("\n")))}function createJSONFile(f){jsonFile={};jsonFile.texts=[];jsonFile.texts.push({name:getFileName("a"),textLength:texts.a.length,group:0});jsonFile.texts.push({name:getFileName("b"),textLength:texts.b.length,group:1});jsonFile.nodes=[];jsonFile.links=[];var b=f.length;var h=true;var a;var d={};var c={};var g=function(k){for(var i=0;i<jsonFile.nodes.length;i++){if(jsonFile.nodes[i].id==k.id){return}}jsonFile.nodes.push(d)};for(var e=0;e<b;e++){a=f[e];d={};d.group=0;d.l=a.l;d.index=a.indexA;d.id="A"+a.indexA;d.text=a.textA;g(d);d={};d.group=3;d.l=a.l;d.index=a.indexB;d.id="B"+a.indexB;d.text=a.textB;g(d);c={};c.source="A"+a.indexA;c.target="B"+a.indexB;c.l=a.l;c.r=a.r;jsonFile.links.push(c)}createFileDownloadLink(getFileDownloadName(".json"),"data:text/json;charset=utf-8,"+encodeURIComponent(JSON.stringify(jsonFile)))}function getFileDownloadName(a){var b="Matches";$(".fileName").each(function(c,d){b+="-"+$(d).html().replace(/\.[^/.]+$/,"")});b+=a.toLowerCase();return b}function createFileDownloadLink(c,a){var b=document.createElement("a");b.download=c;b.href=a;document.body.appendChild(b);b.click();document.body.removeChild(b);delete b};